from typing import List
import sys

class Solution:
    def numberOfCleanRooms(self, room: List[List[int]]) -> int:
        def out_of_bounds(r, c):
            if 0 <= r < rows and 0 <= c < cols:
                return False
            return True
        def solve(r, c, direction):
            #print(r, c, direction)
            if out_of_bounds(r, c) or room[r][c] == 1 or (r, c, direction) in visited:
                return
            visited.add((r, c, direction))
            cleaned.add((r, c))
            all_turns_exhausted = True
            for dr, dc, drctn in hsh[direction]:
                #print(f'\tdr, dc, drctn = {dr}, {dc}, {drctn}')
                rnew = r + dr
                cnew = c + dc
                dnew = drctn
                #print(f'\t\trnew, cnew, dnew = {rnew}, {cnew}, {dnew}')
                #if not (out_of_bounds(rnew, cnew) or room[rnew][cnew] == 1 or (rnew, cnew, dnew) in visited):
                if not (out_of_bounds(rnew, cnew) or room[rnew][cnew] == 1):
                    all_turns_exhausted = False
                    break
            if not all_turns_exhausted:
                #visited.add((r, c, dnew))
                solve(rnew, cnew, dnew)
        rows = len(room)
        cols = len(room[0])
        hsh = {'right': [(0,1,'right'), (1,0,'down'), (0,-1,'left'), (-1,0,'up')],
               'down': [(1,0,'down'), (0,-1,'left'), (-1,0,'up'), (0,1,'right')],
               'left': [(0,-1,'left'), (-1,0,'up'), (0,1,'right'), (1,0,'down')],
               'up': [(-1,0,'up'), (0,1,'right'), (1,0,'down'), (0,-1,'left')]
              }
        visited = set()
        cleaned = set()
        solve(0, 0, 'right')
        return len(cleaned)

